import "../App.css";
import "../stylesheets/Card.css";
import Card from "react-bootstrap/Card";

function Project(props) {
  return (
    <div className="Project">
      <p>poop</p>
      <div className="card">
        <a href={props.link} target="_blank" rel="nofollow">
          <img
            class="card-img-top"
            src="assets/graph.png"
            height="300px"
            alt="graph image"
          />
        </a>
        <div class="card-body">
          <h5 class="card-title">Competitive Programming</h5>
          <p class="card-text">
            solving coding problems by implementing different algorithms
            pertaining but not limited to DP and graph theory.{" "}
          </p>
        </div>
      </div>
    </div>
  );
}

export default Project;
